//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.19;

import "./Adoption.sol";

contract PetDatabase {
    struct Pet {
        string name;
        uint8 age;
        string breed;
        bool isAvailable;
        string image; // New field for the image of the pet
        string location;
        address[] voters;
        uint256 adoptionFee;
    }

    Pet[] public pets; // Array to store pets
    uint petCount = 0;
    Adoption public adoptionInstance;

    constructor(address _adoptionInstance) {
        adoptionInstance = Adoption(_adoptionInstance);
    }

    // Adoption public adoptionContract; // Instance of the Adoption contract

    event PetAdded(
        uint256 indexed petId,
        string name,
        uint8 age,
        string breed,
        bool isAvailable,
        string image, // Updated event to include image
        string location
    );

    // The following function adds a pet to the blockchain of pets [REQUIRES GAS]
    function addPet(
        string memory _name,
        uint8 _age,
        string memory _breed,
        string memory _image, // New parameter for the image
        string memory _location,
        uint256 _adoptionFee
    ) external {
        pets.push(
            Pet(
                _name,
                _age,
                _breed,
                true,
                _image,
                _location,
                new address[](0),
                _adoptionFee
            )
        ); // Push new pet to the array
        petCount = petCount + 1; // Calculate the pet ID

        emit PetAdded(petCount, _name, _age, _breed, true, _image, _location); // Emit the event
    }

    // The following function returns a single pet given a specific petId [DOES NOT REQUIRE GAS]
    function getPet(
        uint256 _petId
    )
        external
        view
        returns (
            string memory,
            uint8,
            string memory,
            bool,
            string memory,
            string memory,
            address[] memory,
            uint256
        )
    {
        require(_petId < pets.length, "Invalid pet ID"); // Validate pet ID

        Pet memory pet = pets[_petId];
        return (
            pet.name,
            pet.age,
            pet.breed,
            pet.isAvailable,
            pet.image,
            pet.location,
            pet.voters,
            pet.adoptionFee
        );
    }

    // The following function returns all pets stored in the blockchain [DOES NOT REQUIRE GAS]
    function getAllPets() external view returns (Pet[] memory) {
        return pets;
    }

    function addVoter(uint256 _petId) external {
        require(_petId < pets.length, "Invalid pet ID");
        pets[_petId].voters.push(msg.sender);
    }

    // Function to remove the sender's address from the voters array of a pet
    function removeVoter(uint256 _petId) external {
        require(_petId < pets.length, "Invalid pet ID");
        address[] storage voters = pets[_petId].voters;
        for (uint256 i = 0; i < voters.length; i++) {
            if (voters[i] == msg.sender) {
                voters[i] = voters[voters.length - 1];
                voters.pop();
                break;
            }
        }
    }

    function hasVoted(uint256 _petId) external view returns (bool) {
        require(_petId < pets.length, "Invalid pet ID");
        address sender = msg.sender;
        address[] storage voters = pets[_petId].voters;

        for (uint256 i = 0; i < voters.length; i++) {
            if (voters[i] == sender) {
                return true;
            }
        }

        return false;
    }

    function adoptPet(uint256 _petId, address payable _ownerAddress) external payable{
        require(_petId < pets.length, "Invalid pet ID"); // Validate pet ID
        require(pets[_petId].isAvailable, "Pet is not available for adoption");

        uint256 adoptionFee = pets[_petId].adoptionFee;
        require(msg.sender.balance >= adoptionFee, "Insufficient balance");


        // Deduct adoption fee from sender and send it to owner
        _ownerAddress.transfer(adoptionFee);

        // Mark the pet as unavailable for adoption
        pets[_petId].isAvailable = false;

        // Call the adopt function in the Adoption contract
        adoptionInstance.adopt(_petId, msg.sender);

        // Emit an event to indicate the pet has been adopted
    }

    function getPetsAdopted() external view returns (uint256[] memory) {
        uint256[] memory adoptedPetIds = new uint256[](pets.length);
        uint256 adoptedCount = 0;

        for (uint256 i = 0; i < pets.length; i++) {
            if (adoptionInstance.getAdopter(i) == msg.sender) {
                adoptedPetIds[adoptedCount] = i;
                adoptedCount++;
            }
        }

        uint256[] memory result = new uint256[](adoptedCount);
        for (uint256 j = 0; j < adoptedCount; j++) {
            result[j] = adoptedPetIds[j];
        }

        return result;
    }

    // // The following function returns an array of pet IDs that match the filtering criteria [DOES NOT REQUIRE GAS]
    // function updatePetAvailability(
    //     uint256 _petId,
    //     bool _isAvailable,
    //     address sender
    // ) external {
    //     require(_petId < pets.length, "Invalid pet ID"); // Validate pet ID
